/*Main Menu*/
.main_menu_wrapper{
    display: none;
    background-color: #fff;
    width: 100%;
    height: auto;
    position: relative;
    z-index: 99;
    box-shadow: 0 1px 5px 0 rgba(0, 0, 0, 0.25);
}   
.main_menu_wrapper .main_menu{
    margin: 0;
    padding: 0;
}
.main_menu_wrapper .main_menu ul{
    margin: 0;
    padding: 10px 0px 10px 0px;
}
.main_menu_wrapper .main_menu ul li{
    margin: 0px 0px 15px 0px;
    padding: 0px 20px;
    list-style: none;
    display: block;
}
.main_menu_wrapper .main_menu ul li a{
    margin: 0px 0px 10px 0px;
    padding: 0;
    color: #333;
    font-family: 'Oswald', sans-serif;
    font-size: 20px;
}
.main_menu_wrapper .main_menu ul li a:hover{
    color: #000;
}
